insert into quote (content, user_id, created_time, total_votes, last_voted) VALUES ( 'The only limit to our realization of tomorrow will be our doubts of today.', 1, '2023-12-10 18:08:00', 15, '2023-12-10 18:15:00' ),
                                                                                ( 'Believe you can and you''re halfway there.', 2, '2023-12-10 18:22:00', 8,'2023-12-10 18:30:00'),
                                                                                ( 'Success is not final, failure is not fatal: It is the courage to continue that counts.', 3, '2023-12-10 18:38:00', 23,'2023-12-10 18:45:00' ),
                                                                                ( 'The only way to do great work is to love what you do.', 4, '2023-12-10 18:53:00', 12, '2023-12-10 19:00:00' ),
                                                                                ( 'You are never too old to set another goal or to dream a new dream.', 5, '2023-12-10 19:08:00', 29, '2023-12-10 19:15:00' ),
                                                                                ( 'Your time is limited, don''t waste it living someone else''s life.', 6, '2023-12-10 19:22:00', 7, '2023-12-10 19:30:00' ),
                                                                                ( 'The future belongs to those who believe in the beauty of their dreams.', 7, '2023-12-10 19:38:00', 18, '2023-12-10 19:45:00' ),
                                                                                ( 'It always seems impossible until it''s done.', 8, '2023-12-10 19:53:00', 5, '2023-12-10 20:00:00' ),
                                                                                ( 'Don''t watch the clock; do what it does. Keep going.', 9, '2023-12-10 20:08:00', 21, '2023-12-10 20:15:00'),
                                                                                ( 'Life is what happens when you''re busy making other plans.', 10, '2023-12-10 20:22:00', 13, '2023-12-10 20:30:00' ),
                                                                                ( 'In three words I can sum up everything I''ve learned about life: it goes on.', 11, '2023-12-10 20:38:00', 26, '2023-12-10 20:45:00'),
                                                                                ( 'The greatest glory in living lies not in never falling, but in rising every time we fall.', 12, '2023-12-10 20:53:00', 9,'2023-12-10 21:00:00'),
                                                                                ( 'The way to get started is to quit talking and begin doing.', 13, '2023-12-10 21:08:00', 16, '2023-12-10 21:15:00'),
                                                                                ( 'Life is either a daring adventure or nothing at all.', 14, '2023-12-10 21:22:00', 3, '2023-12-10 21:30:00' ),
                                                                                ( 'Many of life''s failures are people who did not realize how close they were to success when they gave up.', 15, '2023-12-10 21:38:00', 20, '2023-12-10 21:45:00'),
                                                                                ( 'You have within you right now, everything you need to deal with whatever the world can throw at you.', 16, '2023-12-10 21:53:00', 11, '2023-12-10 22:00:00' ),
                                                                                ( 'The purpose of our lives is to be happy.', 17, '2023-12-10 22:08:00', 28, '2023-12-10 22:15:00'),
                                                                                ( 'Get busy living or get busy dying.', 18, '2023-12-10 22:22:00', 6, '2023-12-10 22:30:00'),
                                                                                ( 'You only live once, but if you do it right, once is enough.', 19, '2023-12-10 22:38:00', 24, '2023-12-10 22:45:00' ),
                                                                                ( 'Success usually comes to those who are too busy to be looking for it.',  20, '2023-12-10 22:53:00', 15, '2023-12-10 23:00:00'),
                                                                                ( 'The only way to do great work is to love what you do.', 21, '2023-12-10 23:08:00', 2, '2023-12-10 23:15:00'),
                                                                                ( 'If you are not willing to risk the usual, you will have to settle for the ordinary.', 22, '2023-12-10 23:22:00', 17, '2023-12-10 23:30:00'),
                                                                                ( 'The biggest adventure you can take is to live the life of your dreams.', 23, '2023-12-10 23:38:00', 10, '2023-12-10 23:45:00'),
                                                                                ( 'The only impossible journey is the one you never begin.', 24, '2023-12-10 23:53:00', 27, '2023-12-11 00:00:00'),
                                                                                ( 'Don''t count the days, make the days count.', 25, '2023-12-11 00:08:00', 14, '2023-12-11 00:15:00'),
                                                                                ( 'Your work is going to fill a large part of your life, and the only way to be truly satisfied is to do what you believe is great work.', 26, '2023-12-11 00:22:00', 5, '2023-12-11 00:30:00'),
                                                                                ( 'Life is what happens when you''re busy making other plans.', 27, '2023-12-11 00:38:00', 22, '2023-12-11 00:45:00'),
                                                                                ( 'It always seems impossible until it''s done.', 28, '2023-12-11 00:53:00', 9,'2023-12-11 01:00:00'),
                                                                                ( 'Don''t watch the clock; do what it does. Keep going.', 29, '2023-12-11 01:08:00', 24, '2023-12-11 01:15:00'),
                                                                                ( 'Life is what happens when you''re busy making other plans.', 30, '2023-12-11 01:22:00',11, '2023-12-11 01:30:00');
